## Introduction

Perennial cropping potentially brings a wide range of environmental and economic benefits. Land sown to perennial pastures have been shown to have higher soil organic carbon levels than land regularly cultivated for cropping (Badgery et al. 2014). A comparison of an annual wheat variety with a wild perennial relative, Intermediate Wheat Grass, illustrated that the wheat grass is deeper rooted than annual wheat and thus can access deeper layers of nutrients and soil water, lessening the risk of nutrient leaching and water table rise (Crews, Carton & Olsson 2018; Culman et al. 2013; DeHaan & Ismail 2017; Duchene et al. 2020; Glover et al. 2010; Soto-Gómez & Pérez-Rodríguez 2022). Another of the perceived benefits of perennial crops is the ability to capture precipitation year-round, unlike annuals which have a relatively short growing season and often leave the soil bare and susceptible to water and wind erosion. Maintaining a perennial crop requires less tillage and spraying than annual cropping, resulting in less machinery operational costs and reduced soil compaction.  .

## Presentation

This model has been built using the Plant Modelling Framework (PMF) of [brown_plant_2014] to simulate the growth of pereennial grains as a grain and forage crop.  The pereennial grain model simulates the above ground plant structure, including the photosynthesis process, using the SimpleLeaf procedure of PMF, which does not consider explicitly leaf age or placement in the canopy.  The model describes a perennial crop, with phenology rewinding to the vegetative stage at the end of the reproductive phase.


## Inclusion in APSIM simulations
To include perennial grain in a simulation the procedure is the same as any other APSIM crop:

 - The perennial grain object can be dragged or copied from the Crop folder in the toolbox into a Field in your simulation;
 - To become active and grow, the perennial grain crop needs to be sown using a manager script with a sowing rule. e.g.:
<pre><code class='language-cs'>
 IntermediateWheatgrass.Sow(cultivar: Colenso, population: 450, depth: 5, rowSpacing: 100);  
</code></pre>
If a specified cultivar is not available, a fatal error will be thrown.


### Harvest and biomass removal
perennial grain biomass can be removed by raising one of the valid methods: Harvest, Cut, Graze, or Prune; this is done using a manager script, similarly to other crops.  The proportion of the biomass of each organ that is removed from the system and/or added to the residue pools may be specified; otherwise defaults will be used.  Note that the sum of fractions removed and added to residue should be <= 1.0.  To specify the proportions for removal in a manager script, use a RemovalFractions class as shown below:
<pre><code class='language-cs'>
[EventSubscribe("Commencing")]  
private void OnSimulationCommencing(object sender, EventArgs e)  
{  
  RemoveFraction = new RemovalFractions(IntermediateWheatgrass.Organs);  
}  
[EventSubscribe("DoManagement")]    
private void OnDoManagement(object sender, EventArgs e)  
{  
  if (Clock.Today.Date == HarvestDate)  
  {  
    RemoveFraction.SetFractionToRemove("Leaf", 0.80);  
    RemoveFraction.SetFractionToRemove("Stem", 0.50);  
    RemoveFraction.SetFractionToResidue("leaf",0.05);
    IntermediateWheatgrass.Harvest(RemoveFraction);  
  }
}  
 </code></pre>
The RemovalFractions class can be sent with Harvest, Cut, Graze, or Prune events. All parameters are optional, defaults are used whenever any value is not specified.


### Crop termination
To fully terminate a crop the EndCrop event should be raised:
<pre><code class='language-cs'>
 IntermediateWheatgrass.EndCrop();  
</code></pre>
Once a crop has been ended the field is open to be used by another APSIM plant model, or another perennial grain crop.  Note that ending perennial grain is not necessary before sowing another crop, competition for resources will take place between crops when there is more than one in the field.
